import React from 'react';

const Repos = ({ className }) => (
  <div className="className">
    <h2>Repositórios</h2>
    <ul>
      <li href="#">
        <a>Nome do repositório</a>
      </li>
      <li href="#">
        <a>Nome do repositório</a>
      </li>
    </ul>
  </div>
);

export default Repos;
